import React from 'react'

var Circle = require('rc-progress').Circle;

class Circle_c extends React.Component{

    render(){
        return(
            <div>
                <div>{props.vote_average}</div>
                <Circle percent="50" style={{width:"50px", marginLeft:"20px"}} strokeWidth="15" strokeColor="#D3D3D3" />
            </div>
        )
    }
}

export default Circle_c
